import React from "react";
import { Link, Router } from "react-router-dom";

function Home(props) {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch("/test")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <>
      <div className="App">
        <header className="App-header">
          <h1>Welcome!</h1>
          <h2>
            This is the home screen, To get started please visit one the screens
            paths
          </h2>
        </header>
      </div>
    </>
  );
}

export default Home;
